def get_sol(): return Solution()
class MinHeapOccupied(list):
    def __init__(self):
        super().__init__()
    # def top(self): return self[0]
    def topTime(self): return self[0][0]
    # def topServerIndex(self): return self[0][1]
    def push(self, time, serverIndex): heappush(self, [time, serverIndex])
    def heappop(self): return heappop(self)
class MinHeapAvailable(list):
    def __init__(self):
        super().__init__()
    # def top(self): return self[0]
    # def topWeight(self): return self[0][0]
    # def topServerIndex(self): return self[0][1]
    def push(self, weight, serverIndex): heappush(self, [weight, serverIndex])
    def heappop(self): return heappop(self)
class Solution:
    def assignTasks(self, servers: List[int], tasks: List[int]) -> List[int]:
        def update(available:MinHeapAvailable, occupied:MinHeapOccupied, cur_time):
            while occupied and occupied.topTime()<=cur_time:
                _,index = occupied.heappop()
                weight = servers[index]
                available.push(weight,index)

        available= MinHeapAvailable()
        for i,w in enumerate(servers): available.push(w,i)
        occupied = MinHeapOccupied()
        q = deque()
        res = []
        cur_time = 0
        while len(res)!=len(tasks):
            update(available,occupied,cur_time)
            if cur_time<len(tasks):
                q.append(tasks[cur_time])
            while q and available:
                time = q.popleft()
                _,idx = available.heappop()
                res.append(idx)
                occupied.push(cur_time+time,idx)
            if cur_time<len(tasks):
                cur_time+=1
            else:
                cur_time = occupied.topTime()

        return res

